async function fetchLatLng(stations) {

    //The android emulator gets buggy/crashes/functions abnormally without taking breaks
    await new Promise(resolve => setTimeout(resolve, 2000));

    const updatedStations = []
    var failure = 0
    
    stations.forEach(station => {
        
        if(typeof station.address === 'undefined') {
            failure++
        }
        else if(station.lat == "0" && typeof station.address !== 'undefined') {
            
            fetch(`https://maps.googleapis.com/maps/api/geocode/json?address=${station.name}%20${station.address}&key=${settings.ApiKeyGoogle}`)
            .then(json => json.json())
            .then(json => {json.status != "ZERO_RESULTS" ? updatedStations.push(createGasStation(json, station)): failure++ })
            .catch(error => console.log(error))

        }
        else {

            updatedStations.push(station)

        }


    });

    await new Promise(resolve => setTimeout(resolve, 2000));

    //for debugging
    var result = `Updated ${updatedStations.length} of ${stations.length} stations with new coordinates from Geocoding API`
    if (failure > 0 ) { result += ` (${failure} fetch(es) returned ZERO_RESULTS)` }
    console.log(result)
    
    return updatedStations

 }


